import React from 'react';
import { Paper, Typography, Box, CircularProgress, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import CheckCircleOutlineIcon from '@mui/icons-material/CheckCircleOutline';

const RecoveryGoal = () => {
  const progress = 75; // Example progress value

  const goals = [
    "30 minutes of cardio exercise",
    "Eat 5 servings of vegetables",
    "8 hours of sleep",
    "10,000 steps"
  ];

  return (
    <Paper elevation={3} sx={{ p: 3, height: '300px', display: 'flex', flexDirection: 'column' }}>
      <Typography variant="h5" gutterBottom align="center">Recovery Goal</Typography>
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', mb: 2 }}>
        <Box sx={{ position: 'relative', display: 'inline-flex', mr: 2 }}>
          <CircularProgress variant="determinate" value={progress} size={80} />
          <Box
            sx={{
              top: 0,
              left: 0,
              bottom: 0,
              right: 0,
              position: 'absolute',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
            }}
          >
            <Typography variant="h6" component="div" color="text.secondary">
              {`${Math.round(progress)}%`}
            </Typography>
          </Box>
        </Box>
        <Typography variant="body1" align="center">Daily goals completed</Typography>
      </Box>
      <List dense sx={{ width: '100%', maxWidth: 360, mx: 'auto' }}>
        {goals.map((goal, index) => (
          <ListItem key={index} sx={{ px: 0 }}>
            <ListItemIcon>
              <CheckCircleOutlineIcon color="primary" />
            </ListItemIcon>
            <ListItemText primary={goal} primaryTypographyProps={{ variant: 'body2' }} />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default RecoveryGoal;
